import "./MovieList.css";

const MovieList = () => {
  return (
    <div className="movieList shadow mx-auto mt-4 p-1 rounded-2">
      <MovieItem />
      <MovieItem />
      <MovieItem />
    </div>
  );
};

export default MovieList;
